import React from "react";
import { Statistic, Icon } from "semantic-ui-react";
import "../../styles/Statistic.css";
class UnChangableStatistic extends React.Component {
  //Change the default number here
  state = {
    count: 1000,
  };

  renderContent = () => {
    return (
      <div>
        <h5 className="no-margin">{this.props.text}</h5>
        <div className="statistic-container">
          <Icon className="icon-margin" name={this.props.name} size="huge" color={this.props.color} />
          <Statistic vertical className="number-text">
            <Statistic.Value>{this.state.count}</Statistic.Value>
            <Statistic.Label>{this.props.label}</Statistic.Label>
          </Statistic>
        </div>
      </div>
    );
  };
  render() {
    return this.renderContent();
  }
}

export default UnChangableStatistic;
